import React from 'react'

export default function Solution() {
    return (
        <div className="solution-container">
            <img src="/items/logo2.png" alt="logo"></img>
            <h1>Brindamos soluciones personalizadas y a medida que nos llevan a construir relaciones de largo plazo con nuestros clientes.</h1>
            <p>------------------------------------------------------------------------------------------------------------------------</p>
            <h5>El profesionalismo, confiabilidad, y la larga trayectoria de nuestro personal superior junto a la constante búsqueda de la excelencia nos llevaron a consolidar una Casa de Bolsa independiente, versátil y con presencia en el mercado de capitales local e internacional.</h5>
        </div>
    )
}
